import React from 'react';

function Dashboard() {
  const containerStyle = {
    display: 'flex',
    fontFamily: "'Playfair Display', serif",
    color: '#1a1a1a',
    backgroundColor: '#f8f8f8',
    minHeight: '100vh',
  };

  // Sidebar
  const sidebarStyle = {
    width: '240px',
    backgroundColor: '#000',
    color: '#d4af37',
    padding: '20px',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-between',
  };

  const sidebarHeaderStyle = {
    fontSize: '1.5rem',
    fontWeight: 'bold',
    marginBottom: '40px',
    textAlign: 'center',
    borderBottom: '1px solid #d4af37',
    paddingBottom: '10px',
  };

  const navItemStyle = {
    padding: '12px 0',
    cursor: 'pointer',
    fontWeight: '500',
    borderBottom: '1px solid rgba(212, 175, 55, 0.3)',
  };

  const navItemHoverStyle = {
    color: '#fff',
  };

  // Main content
  const mainStyle = {
    flex: 1,
    padding: '30px',
  };

  const topBarStyle = {
    backgroundColor: '#fff',
    padding: '15px 20px',
    borderRadius: '6px',
    marginBottom: '30px',
    boxShadow: '0 2px 5px rgba(0,0,0,0.05)',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  };

  const headingStyle = {
    fontSize: '2rem',
    fontWeight: 300,
    textTransform: 'uppercase',
    letterSpacing: '0.1em',
  };

  const cardGridStyle = {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
    gap: '20px',
  };

  const cardStyle = {
    backgroundColor: '#fff',
    padding: '20px',
    borderRadius: '6px',
    boxShadow: '0 2px 5px rgba(0,0,0,0.05)',
  };

  const cardTitleStyle = {
    fontSize: '1.1rem',
    marginBottom: '10px',
    fontWeight: 'bold',
    color: '#000',
  };

  const cardValueStyle = {
    fontSize: '1.8rem',
    fontWeight: '300',
    color: '#d4af37',
  };

  return (
    <div style={containerStyle}>
      {/* Sidebar */}
      <div style={sidebarStyle}>
        <div>
          <div style={sidebarHeaderStyle}>DIOR Admin</div>
          <div style={navItemStyle}>Dashboard</div>
          <div style={navItemStyle}>Products</div>
          <div style={navItemStyle}>Orders</div>
          <div style={navItemStyle}>Analytics</div>
          <div style={navItemStyle}>Settings</div>
        </div>
        <div style={{ fontSize: '0.85rem', textAlign: 'center', opacity: 0.7 }}>
          Â© 2025 Dior
        </div>
      </div>

      {/* Main */}
      <div style={mainStyle}>
        {/* Top bar */}
        <div style={topBarStyle}>
          <h2 style={headingStyle}>Dashboard</h2>
          <div>Welcome, Admin</div>
        </div>

        {/* Stats */}
        <div style={cardGridStyle}>
          <div style={cardStyle}>
            <div style={cardTitleStyle}>Total Products</div>
            <div style={cardValueStyle}>128</div>
          </div>
          <div style={cardStyle}>
            <div style={cardTitleStyle}>Monthly Sales</div>
            <div style={cardValueStyle}>$12,430</div>
          </div>
          <div style={cardStyle}>
            <div style={cardTitleStyle}>Pending Orders</div>
            <div style={cardValueStyle}>14</div>
          </div>
          <div style={cardStyle}>
            <div style={cardTitleStyle}>Boutiques</div>
            <div style={cardValueStyle}>5</div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
